import React, { Component } from 'react';
import DropDown from './Components/DropDown'
import FormField from './Elements/FormField'

import CircularImage from './Elements/CircularImage'
import './App.css';
var vet_image = "https://www.nomnomnow.com/images/home/justin_square.jpg"
var dog_food_image = "https://www.nomnomnow.com//images/home/chicken_bowl_transparent.png"
var other_dog_food_data = {
    "Taste of The Wild" : [
        {
            name: "High Prairie Canine Recipe with Roasted Bison & Roasted Venison",
            protein: 32.0,
            fat: 18.0,
            calorie: 3719,
        },
        {
            name: "Pine Forest Canine Recipe with Venison & Legumes",
            protein: 28.0,
            fat: 15.0,
            calorie: 3600,
        },
        {
            name: "Southwest Canyon Canine Recipe with Wild Boar",
            protein: 29.0,
            fat: 15.0,
            calorie: 3600,
        }
    ],
    "Blue Buffalo" :[
        {
            name: "Life Protection Formula速 Chicken and Brown Rice Recipe (For Puppies)",
            protein: 27.0,
            fat: 16.0,
            calorie: 3686,
        },
        {
            name: "Life Protection Formula速 Fish and Brown Rice Recipe",
            protein: 22.0,
            fat: 14.0,
            calorie: 3619,
        }
    ],
    "Diamond Naturals" : [
        {
            name: "Skin & coat all life stages dog salmon & potato formula",
            protein: 25.0,
            fat: 14.0,
            calorie: 3600,
        },
        {
            name: "Adult Dog beef meal & rice formula",
            protein: 25.0,
            fat: 15.0,
            calorie: 3518,
        }
    ]
}

var nomNomNow_dog_food = [
    {
        name: "Porkalicious Potluck",
        protein: 10.0,
        fat: 4.5,
        calorie: 1275,
    },
    {
        name: "Heartland Beef Mash",
        protein: 8.0,
        fat: 6.0,
        calorie: 1155,
    },
    {
        name: "Chicken Chow-Wow",
        protein: 8.5,
        fat: 6.0,
        calorie: 1189,
    },
    {
        name: "Tasty Turkey Fare",
        protein: 10.0,
        fat: 5.0,
        calorie: 1372,
    }
]
class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            selectedDogFood: null,
            selectedRecipe: nomNomNow_dog_food[0]
        };
    }

    selectDogFood(food){
        this.setState({
            selectedDogFood: food
        })
    }
    selectRecipe(recipe){
        this.setState({
            selectedRecipe: recipe
        })
    }

    render() {
        return (
          <div className="App">
              <div className="DogFoodCalculator">
                  <div className="left-side">
                      <h1 className="header">Dog food comparison calculator</h1>
                      <div className="text-wrapper">
                          <div className="img-text-wrapper">
                              <CircularImage imgSrc="https://www.nomnomnow.com/images/home/justin_square.jpg" altTxt ="NomNomNow's leading nutritionist"/>

                              <p>Dr. Shmalberg says: We should feed by calorie, not by weight. Percentages on commercial dog food labels are not reliable because they are based on weight, and the values are affected by many factors, including moisture, fiber and minerals.</p>
                          </div>
                          <p>Use this calculator to get a more accurate picture of how another dog food brand compares with NomNomNow.
                          </p>
                      </div>

                      <div className="form-field-dropdowns">
                          <DropDown title="Name of dog food brand"
                                    list={other_dog_food_data}
                                    selected={this.state.selectedDogFood}
                                    hasSubCategory={true}
                                    select={this.selectDogFood.bind(this)}/>

                          <DropDown title="Compare with NomNomNow"
                                    list={nomNomNow_dog_food}
                                    selected={this.state.selectedRecipe}
                                    select={this.selectRecipe.bind(this)}/>
                      </div>
                      <div>
                          <p style={{}}>Dog food brand's nutrient info:</p>
                          <div className="form-wrap">
                              <FormField placeholder=""
                                         title={"% protein (min.)"}
                                         selectable={false}
                                         selected={this.state.selectedDogFood ? this.state.selectedDogFood.protein + "%" : null}/>
                              <FormField placeholder=""
                                         title={"% fat (min.)"}
                                         selectable={false}
                                         selected={this.state.selectedDogFood ? this.state.selectedDogFood.fat + "%" : null}/>
                              <FormField placeholder=""
                                         title={"Caloric density (kcal/kg)"}
                                         selectable={false}
                                         selected={this.state.selectedDogFood ? this.state.selectedDogFood.calorie : null}/>
                          </div>
                      </div>
                  </div>
                  <div className="right-side" >
                      <img className="dog-food" src={dog_food_image} alt="Yummy NomNomNow Dog Food"/>
                  </div>
              </div>
              <div className="nutrition-comparison">
                  <p>See the the nutrient comparison below</p>
                  <div className="comparisons">
                      <div className="outside-dog-food">

                      </div>
                      <div className="nomnomnowfood">

                      </div>
                  </div>
                  <p>Learn about the role of protein, fat, and carbs in a dog's diet.</p>
              </div>
          </div>
        );
    }
}

export default App;
